import React, { useState } from "react";
import TextField from "@mui/material/TextField";
import Box from "@mui/material/Box";
import { IconButton } from "@mui/material";
import { Visibility } from "@mui/icons-material";
import { VisibilityOff } from "@mui/icons-material";
import { FormControl } from "@mui/material";
import { InputLabel } from "@mui/material";
import { OutlinedInput } from "@mui/material";
import { InputAdornment } from "@mui/material";
import { Button } from "@mui/material";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import dayjs from "dayjs";
import { useNavigate } from "react-router-dom";

export default function SignUp() {
  const [showPassword, setShowPassword] = useState(false);
  const [password,setPassWord]=useState('');
  const navigate=useNavigate()
  const [email,setEmail]=useState('')
  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const handledInputChange=(e)=>{
    setEmail(e.target.value)
  }
  const handledPasswordChange=(e)=>{
    setPassWord(e.target.value)
  }

  const [value, setValue] = useState(dayjs());

  const LoginPage=()=>{
    if(password.length>=8){
        navigate('/login')
        const User={ emailAddress:email, password:password}
        const existingUsers =JSON.parse(localStorage.getItem('Users')) || [];
        const updatedUers=[...existingUsers,User]
        localStorage.setItem('Users',JSON.stringify(updatedUers))
        console.log(User)
    }else{
        alert("Passwordlength is less than 8")
        setPassWord('')
    }
  }


  return (
    <>
      <Box
      component="form"
      sx={{
      height:500,
      width:480,
      my:10,
      mx:60,
      display:"flex",
      flexDirection:"column",
      alignItems:"center",
      justifyContent:"center",
      border: '2px solid grey',
      borderRadius:'20px',
      bgcolor:'#cfd8dc' }}
      >
        <div>
            <h1>Sign Up</h1>
            <p>It's Quick And Easy</p>
        </div>
        <div>
          <TextField
            id="outline-required"
            label="First-Name"
            // defaultValue="Hello World"
          />
          <TextField
            id="outline-required"
            label="Last Name"
            // defaultValue="Hello World"
          />
          <br />
          <FormControl sx={{ margin:'10px 2px 10px 2px', width: "48ch" }}>
            <TextField
              id="outlined-email-input"
              label="Mobile number or Email Address"
              value={email}
              onChange={handledInputChange}
            />
          </FormControl>
          <br />
          <FormControl sx={{ margin:'10px 2px 10px 30px', width: "40ch" }} variant="outlined">
            <InputLabel htmlFor="outlined-adornment-password" >
              New Password
            </InputLabel>
            <OutlinedInput
              id="outlined-adornment-password"
              type={showPassword ? "text" : "password"}
              endAdornment={
                <InputAdornment position="end">
                  <IconButton
                    aria-label="toggle password visibility"
                    onClick={handleClickShowPassword}
                    onMouseDown={handleMouseDownPassword}
                    edge="end"
                  >
                    {showPassword ? <VisibilityOff /> : <Visibility />}
                  </IconButton>
                </InputAdornment>
              }
              label="New Password"
              value={password} onChange={handledPasswordChange}
            />
          </FormControl>
        </div>
      
      <div>
        <LocalizationProvider dateAdapter={AdapterDayjs}>
            <DatePicker
                sx={{margin:'10px 2px 10px 2px'}}
              label="Date of Birth"
              value={value}
              onChange={(newValue) => setValue(newValue)}
            />
        </LocalizationProvider>
      </div>
      <Button variant="contained" sx={{margin:'10px 2px 10px 2px'}} onClick={()=>{LoginPage()}}>
        Submit Details
      </Button>
      </Box>
    </>
  );
}
